export const go=(e,t)=>{if(t){let r="";for(let e in t)r=r+"&"+e+"="+t[e];return uni.navigateTo({url:e+"?"+r,complete(e){}})}return uni.navigateTo({url:e,complete(e){}})};export const reGo=(e,t)=>{if(t){let r="";for(let e in t)r=r+"&"+e+"="+t[e];return uni.redirectTo({url:e+"?"+r,complete(e){}})}return uni.redirectTo({url:e,complete(e){}})};export const back=(e=1)=>uni.navigateBack({delta:e,complete(e){info=e}});export const tabBar=(e,t)=>{if(t){let r="";for(let e in t)r=r+"&"+e+"="+t[e];return uni.switchTab({url:e+"?"+r,complete(e){}})}return uni.switchTab({url:e,complete(e){}})};